CREATE DEFINER=`root`@`%` PROCEDURE `item_availability`(IN loc_to_param int, IN as_of_date_param date, IN show_sock int)
BEGIN
    if show_sock = 0 THEN
        # get all items with stock or not
        select loc_to_param                                            as 'loc_id',
               item_code                                               as 'item_code',
               barcode                                                 as 'barcode',
               item_desc,
               (select SUM(tran_qty)
                from stk_tran
                where loc_to = loc_to_param
                  and stk_tran.item_code = prod_master.item_code
                  and DATE(stk_tran.date_created) <= as_of_date_param) as 'stock'
        from prod_master
        order by stock desc;
    ELSE
        # get only stock items available
        select loc_to_param                                            as 'loc_id',
               item_code                                               as 'item_code',
               barcode                                                 as 'barcode',
               item_desc,
               (select SUM(tran_qty)
                from stk_tran
                where loc_to = loc_to_param
                  and stk_tran.item_code = prod_master.item_code
                  and DATE(stk_tran.date_created) <= as_of_date_param) as 'stock'
        from prod_master
        where (select SUM(tran_qty)
               from stk_tran
               where loc_to = loc_to_param
                 and stk_tran.item_code = prod_master.item_code
                 and DATE(stk_tran.date_created) <= as_of_date_param) > 0
        order by stock desc;
    END IF;
END ;;
